import { TextField } from '@mui/material'
import React from 'react'

const TextInput = (label ,formData ,handleChange) => {
  return (
    <div>
         <TextField
                    label={label}
                    name="firstName"
                    value={formData.firstName}
                    onChange={handleChange}
                    fullWidth
                    margin="normal"
                    className="input-field"
                  />
    </div>
  )


    return (
      <div>
         <TextField
                       label={label}
                       name="lastName"
                       value={formData.lastName}
                       onChange={handleChange}
                       fullWidth
                       margin="normal"
                       className="input-field"
                     />"
      </div>
    )
}
export default TextInput
